/* eslint no-unused-vars: [ "off", { "argsIgnorePattern": "tw" } ] */
import React from 'react'
import tw, { styled } from 'twin.macro'
import { Link } from 'gatsby'
import { css, keyframes } from "styled-components";
import { Section } from '@hummingbot/hbui/elements/layout'
import { Container } from '../../elements/layout' /* custom container with more left-right padding */
import { H1, H6 } from '@hummingbot/hbui/elements/typography'
import { BackgroundNodes } from "../BackgroundNodes"
import GradOval from './assets/OvalGradientLower.svg'
import { ItemsRow } from '@hummingbot/hbui/elements/layout'
import { CustomRoundButton, ExternalLinkButton } from "../../elements/buttons"

function Hero() {
  return (
    <Section tw='relative h-[500px] md:h-[700px] lg:h-[800px]' style={{overflow: 'hidden'}}>
      <div style={{opacity: '0.5', position: 'absolute', top: '100%', left: '50%', width: '1989px', height: '1083px'}}>
        <img src={GradOval} alt='test' style={{zIndex: '0', position: 'relative', top: '-50%', left: '-50%', width: '1989px', height: '1083px'}} />
      </div>
      <span tw='hidden md:inline'>
        <BackgroundNodes />
      </span>
      <Section tw='h-[500px] md:h-[700px] lg:h-[800px]' style={{justifyContent: 'center'}}>
        <Container tw='z-10 pt-0 pb-7 md:pb-8 lg:pb-9 xl:pb-10'>
          <CustomH1 isBold tw='lg:max-w-4xl pb-xs'>Open Source<br />Market Making</CustomH1>
          <H6 tw='text-white max-w-[600px] mb-lg'>Hummingbot is open source software that helps you build <strong>high-frequency crypto trading bots
          </strong> that specialize in market making and arbitrage strategies</H6>
          <ItemsRow>
          <a href="/test-drive">
            <CustomRoundButton  isLarge>Test Drive</CustomRoundButton>
          </a>
            <a href="https://hummingbot.thinkific.com">
              <ExternalLinkButton isLarge label="Learn with Botcamp" />
            </a>
          </ItemsRow>
          <div tw='absolute hidden lg:block xl:(right-[20%]) lg:(right-[2%]) top-[30%]'>
            <HummingbotBird />
            <MinerClientIllustration />
          </div>
        </Container>
      </Section>
      <BottomGradientLine />
    </Section>
  )
}

export default Hero

const CustomH1 = styled(H1)({
  background: 'linear-gradient(270deg, #00C2CE 25.96%, #318DFF 100%)',
  WebkitTextFillColor: 'transparent',
  WebkitBackgroundClip: 'text',
  lineHeight: '100%',
})


const BottomGradientLine = styled.div({
  position: 'absolute',
  bottom: '0',
  left: '0',
  width: '100%',
  height: '3px',
  background: 'linear-gradient(270deg, #00C2CE 25.96%, #318DFF 100%)',
})



// vertical movement
const elevator = keyframes`
  0% { transform: translateY( -10px )}
  100% { transform: translateY( 10px )}
`
const animationVertical = props =>
  css`
    ${elevator} 0.6s ease-in-out infinite alternate;
  `

// wings movement
const wingFlutter = keyframes`
  0% { transform: rotate( -45deg ) }
  100% { transform: rotate( 25deg ) }
`
const wingFlutterShorter = keyframes`
  0% { transform: rotate( -40deg ) }
  100% { transform: rotate( 10deg ) }
`
const wingFlutterShortest = keyframes`
  0% { transform: rotate( -20deg ) }
  100% { transform: rotate( 10deg ) }
`
const animationWings = props =>
  css`
    ${wingFlutter} 0.6s ease-in-out infinite alternate;
  `
const animationWingsShorter = props =>
  css`
    ${wingFlutterShorter} 0.6s ease-in-out infinite alternate;
  `
const animationWingsShortest = props =>
  css`
    ${wingFlutterShortest} 0.6s ease-in-out infinite alternate;
  `

const AnimatedBirdSVG = styled.svg({
  animation: animationVertical,
  animationDelay: "0.2s",
  "& .wing-front": {
		transformOrigin: "56% 58%",
  	animation: animationWings,
  	position: "relative",
  	top: "0",
  	left: "40px",
  },
  "& .wing-back": {
		transformOrigin: "60% 58%",
  	animation: animationWingsShorter,
  },
  "& .wing-background": {
		transformOrigin: "60% 58%",
  	animation: animationWingsShortest,
  }
})

